import { useState } from "react";
import { useEffect } from "react";

export default function Eachngo(props){
    const [eachngo, seteachngo] = useState()
    useEffect(() => {
        fetch(`http://127.0.0.1:8000/ngo-list/${props.id}/`, {
        'method' : 'GET'
        })
            .then(res => res.json())
            .then(data => console.log(data))
    }, [])
    return (
        <div>{eachngo.title}</div>
    )
}
